import React from "react";
export default props => {
    const styles = {
        textAlign: "center"
    };

    return (
        <div className="form-group">
            <label style={styles} for="formGroupExampleInput"> 
                {props.label} 
            </label>
            
            <input 
            style={styles}
            type={props.type} 
            className="form-control" 
            placeholder={props.placeholder}/>
        </div>
    )
};
